import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { LoadScript } from "@react-google-maps/api";
import Dashboard from './components/Dashboard';
import HomePage from './pages/HomePage';
import AnalyticsPage from './pages/AnalyticsPage';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import CreateFieldPage from './pages/CreateFieldPage';
import FieldPage from './pages/FieldPage';
import ProfilePage from './pages/ProfilePage';

import PrivateRoute from './utils/PrivateRoute';

import "./styles/App.css";
import './styles/index.css';

const GOOGLE_MAPS_API_KEY = "AIzaSyC6-KT4EaMNrVuln5DQ5Xn8e8n4kZwsKMU";

function App() {
    return (
        <LoadScript googleMapsApiKey={GOOGLE_MAPS_API_KEY} libraries={['geometry']}>
            <Router>
                <Routes>
                    {/* Публічні сторінки */}
                    <Route path="/login" element={<LoginPage />} />
                    <Route path="/register" element={<RegisterPage />} />

                    <Route path="/" element={<Dashboard />}>
                        {/* Публічні або загальнодоступні сторінки всередині Dashboard (якщо є) */}

                        {/* Приватні сторінки */}
                        <Route
                            path="home"
                            index
                            element={
                                <PrivateRoute>
                                    <HomePage />
                                </PrivateRoute>
                            }
                        />
                        <Route
                            path="create-field"
                            element={
                                <PrivateRoute>
                                    <CreateFieldPage />
                                </PrivateRoute>
                            }
                        />
                        <Route
                            path="field/:id/edit"
                            element={
                                <PrivateRoute>
                                    <CreateFieldPage />
                                </PrivateRoute>
                            }
                        />
                        <Route
                            path="field/:id"
                            element={
                                <PrivateRoute>
                                    <FieldPage />
                                </PrivateRoute>
                            }
                        />
                        <Route
                            path="analytics"
                            element={
                                <PrivateRoute>
                                    <AnalyticsPage />
                                </PrivateRoute>
                            }
                        />
                        <Route
                            path="profile"
                            element={
                                <PrivateRoute>
                                    <ProfilePage />
                                </PrivateRoute>
                            }
                        />
                    </Route>

                </Routes>
            </Router>
        </LoadScript>
    );
}

export default App;
